import React, { useState, useEffect } from 'react';
import ReactStopwatch from 'react-stopwatch';

export const Timer = () => {
	const [seconds, setSeconds] = useState(0);

	useEffect(() => {
		setSeconds(seconds + 1);
	}, []);

	return (<p>{seconds}</p>);
}

export default Timer;
